import React from 'react';
import {Link} from 'react-router-dom';
const myStore = (props) => {
  return (
    <div className="customer" style={{padding:"10%",display:"inline-block",backgroundImage:`url(${require("../../logo.svg")})`,backgroundSize:"cover"}}>
      <a href={props.url} target="_blank">{props.name}</a>
    </div>
  )
}
export default myStore;
